import Head from "next/head";
import Header from "./header";

import { grey } from "@material-ui/core/colors";

const Layout = (props) => (
  <React.Fragment>
    <Head>
      <title>Harrassment</title>
    </Head>

    <Header />

    <div style={{ backgroundColor: grey[200] }}>{props.children}</div>
  </React.Fragment>
);

export default Layout;
